function squarePointCorners(centerPos, idx, total, r) {
    // выбираем угол: 0 = верх-лево, 1 = верх-право, 2 = низ-право, 3 = низ-лево
    const corner = idx % 4;

    let x = centerPos.x;
    let y = centerPos.y;

    switch(corner) {
        case 0: // верх-лево
            x -= r;
            y -= r;
            break;
        case 1: // верх-право
            x += r;
            y -= r;
            break;
        case 2: // низ-право
            x += r;
            y += r;
            break;
        case 3: // низ-лево
            x -= r;
            y += r;
            break;
    }

    return new Vector_Vector(x, y);
}
